// };

class Naver extends Component{
 
 
  render(){

  
  return (
    <div>
      <Navbar color="dark" dark>
        <Nav className="ml-auto" navbar>
          <NavItem><NavLink to="/" >Home</NavLink></NavItem>
          <NavItem><NavLink to="/section/US">US</NavLink></NavItem>
          <NavItem><NavLink to="/section/World" refresh={true}>World</NavLink></NavItem>
          <NavItem><NavLink to="/section/Politics" refresh={true}>Politics</NavLink></NavItem>
          <NavItem><NavLink to="/section/Business" refresh={true}>Business</NavLink></NavItem>
          <NavItem><NavLink to="/section/Technology" refresh={true}>Technology</NavLink></NavItem>
          <NavItem><NavLink to="/section/Sports" refresh={true}>Sports</NavLink></NavItem>
          <NavItem><NavLink to="/section/Gaming" refresh={true}>Gaming</NavLink></NavItem>
          <NavItem><NavLink to="/section/Feedback" refresh={true}>Feeback</NavLink></NavItem>
        </Nav>
      </Navbar>
    </div>
  );
 }
}

export default Naver;
